func isValid(s string) bool {
    stack := Stack{}

    for _, ch := range s {
        d := rune(ch)

        if d == '(' || d == '{' || d == '[' {
            stack.Push(d)
        } else if (d == ')' && stack.Peek() == '(') ||
                  (d == '}' && stack.Peek() == '{') ||
                  (d == ']' && stack.Peek() == '[') {
            stack.Pop()
        } else {
            return false
        }
    }

    return stack.IsEmpty()
}


4.3 permutation 순열





(시간/공간)복잡도




범위,제한사항




아이디어
스택에 쌓아둔 숫자들을 꺼내어 모든 가능한 조합을 만들어가는 과정을 반복하며 순열을 생성합니다. 여기서 스택은 이미 선택한 숫자들을 추적하고, 백트래킹을 위해 사용됩니다. 이전 단계로 돌아가면서 조합을 생성하고 탐색하는 방식이기 때문에,  재귀를 사용하지 않고도 순열을 구할 수 있게 되었습니다. 이러한 방식은 스택을 활용하여 재귀적인 구조를 명시적으로 구현하지 않고도 순열 문제를 해결하는 좋은 방법 중 하나입니다.



package main

import "fmt"

func permute(nums []int) [][]int {
    result := [][]int{}
    stack := []int{}
    used := make([]bool, len(nums))

    for len(stack) > 0 || len(nums) > 0 {
        if len(stack) == len(nums) {
            // 스택에 모든 요소가 쌓였을 때 순열을 결과에 추가
            current := make([]int, len(stack))
            copy(current, stack)
            result = append(result, current)
        }

        for i, num := range nums {
            if used[i] {
                continue
            }

            // 숫자를 사용하고 스택에 추가
            used[i] = true
            stack = append(stack, num)

            // 다음 숫자로 이동
            nums = nums[:i+copy(nums[i:], nums[i+1:])]

            // 스택을 기반으로 백트래킹하여 순열을 생성
            break
        }

        // 스택에서 마지막 요소 제거 및 해당 숫자의 사용 표시 해제
        if len(stack) > 0 {
            last := stack[len(stack)-1]
            used[numIndex(nums, last)] = false
            stack = stack[:len(stack)-1]
        }
    }

    return result
}

func numIndex(nums []int, num int) int {
    for i, n := range nums {
        if n == num {
            return i
        }
    }
    return -1
}

func main() {
    nums := []int{1, 2, 3}
    result := permute(nums)
    fmt.Println(result)
}

