스택 자료구조를 활용하여 현재 탐색 중인 노드를 스택에 넣고 해당 노드의 자식 노드 중 하나를 선택하여 다시 스택에 넣는 방식
package main

import (
    "fmt"
)

// TreeNode는 기본 트리 노드 구조체입니다.
type TreeNode struct {
    Value int
    Left  *TreeNode
    Right *TreeNode
}

// StackNode는 스택에 저장할 노드 구조체입니다.
type StackNode struct {
    Node  *TreeNode
    Level int
}

// Stack은 스택 구조체입니다.
type Stack struct {
    Nodes []StackNode
}

// Push는 스택에 노드를 추가합니다.
func (s *Stack) Push(node *TreeNode, level int) {
    s.Nodes = append(s.Nodes, StackNode{Node: node, Level: level})
}

// Pop는 스택에서 노드를 꺼냅니다.
func (s *Stack) Pop() (node *TreeNode, level int) {
    if len(s.Nodes) == 0 {
        return nil, -1
    }
    index := len(s.Nodes) - 1
    node, level = s.Nodes[index].Node, s.Nodes[index].Level
    s.Nodes = s.Nodes[:index]
    return node, level
}

// DFS는 스택을 사용하여 깊이 우선 탐색을 수행합니다.
func DFS(root *TreeNode) {
    if root == nil {
        return
    }

    stack := Stack{}
    stack.Push(root, 0)

    for len(stack.Nodes) > 0 {
        node, level := stack.Pop()
        fmt.Printf("Level %d: %d\n", level, node.Value)

        // 오른쪽 자식을 먼저 스택에 넣어야 왼쪽 자식이 먼저 나오게 됩니다.
        if node.Right != nil {
            stack.Push(node.Right, level+1)
        }
        if node.Left != nil {
            stack.Push(node.Left, level+1)
        }
    }
}

func main() {
    // 트리 생성 예시:      1
    //                /   \
    //               2     3
    //              / \   / \
    //             4   5 6   7
    root := &TreeNode{
        Value: 1,
        Left: &TreeNode{
            Value: 2,
            Left: &TreeNode{
                Value: 4,
            },
            Right: &TreeNode{
                Value: 5,
            },
        },
        Right: &TreeNode{
            Value: 3,
            Left: &TreeNode{
                Value: 6,
            },
            Right: &TreeNode{
                Value: 7,
            },
        },
    }

    fmt.Println("Depth First Search:")
    DFS(root)
}

